function confirm_action(text){var agree=confirm(text);if(agree){return!0}else{return!1}}
function escapeHtml(str){var div=document.createElement('div');div.appendChild(document.createTextNode(str));var output=div.innerHTML;div=undefined;return output}
function preview_edit(){var preview_form=document.getElementById('v-edit-preview');var edit_form=document.getElementById('v-edit');if(edit_form&&preview_form){var title=document.getElementById('inputTitle');var desc=document.getElementById('insert_desc');var body=document.getElementById('insert_body');var tags=document.getElementById('insert-tags');var img=document.getElementById('article-image');var header=document.getElementById('header-article');var imgs=document.getElementById('article-image-select');var prev_title=document.getElementById('prev-title');var prev_desc=document.getElementById('prev-desc');var prev_body=document.getElementById('prev-body');var prev_tags=document.getElementById('prev-tags');if(!title||!desc||!body||!tags||!prev_title||!prev_desc||!prev_body||!prev_tags){console.log("One of the fields was blank.");return}
var base_url=document.getElementById('base_url').value;if(img&&header){imgsrc=img.value.trim();if(imgsrc!=""){header.style.background="url('"+base_url+"imgs/"+imgsrc+"') center center no-repeat"}}else if(imgs&&header){var imgsrc=imgs.value.trim();if(imgsrc!=""){header.style.background="url('"+base_url+"imgs/"+imgsrc+"') center center no-repeat"}}
var tags_html="";var tags_array=tags.value.split(',');if(tags_array&&tags_array.length>0){for(var i=0;i<tags_array.length;i++){var cur_tag=escapeHtml(tags_array[i]);tags_html+=" <a href=\""+base_url+"tag?tag="+cur_tag+"\">#"+cur_tag+"</a> "}}
prev_title.innerHTML=title.value;prev_desc.innerHTML=desc.value;prev_body.innerHTML=body.value;prev_tags.innerHTML=tags_html;edit_form.style.display='none';preview_form.style.display='block';if(rm){var html=process_markdown();preview_markdown(html);submit_markdown(html)}}}
function preview_create(){var preview_form=document.getElementById('v-edit-preview');var edit_form=document.getElementById('v-edit');if(edit_form&&preview_form){var title=document.getElementById('inputTitle');var desc=document.getElementById('insert_desc');var body=document.getElementById('insert_body');var tags=document.getElementById('insert-tags');var img=document.getElementById('article-image');var header=document.getElementById('header-article');var imgs=document.getElementById('article-image-select');var prev_title=document.getElementById('prev-title');var prev_desc=document.getElementById('prev-desc');var prev_body=document.getElementById('prev-body');var prev_tags=document.getElementById('prev-tags');if(!title||!desc||!body||!tags||!prev_title||!prev_desc||!prev_body||!prev_tags){console.log("One of the fields was blank.");return}
var base_url=document.getElementById('base_url').value;if(img&&header){var imgsrc=img.value.trim();if(imgsrc!=""){header.style.background="url('"+base_url+"imgs/"+imgsrc+"') center center no-repeat"}}else if(imgs&&header){var imgsrc=imgs.value.trim();if(imgsrc!=""){header.style.background="url('"+base_url+"imgs/"+imgsrc+"') center center no-repeat"}}
var tags_html="";var tags_array=tags.value.split(',');if(tags_array&&tags_array.length>0){for(var i=0;i<tags_array.length;i++){var cur_tag=escapeHtml(tags_array[i]);tags_html+=" <a href=\""+base_url+"tag?tag="+cur_tag+"\">#"+cur_tag+"</a> "}}
prev_title.innerHTML=title.value;prev_desc.innerHTML=desc.value;prev_body.innerHTML=body.value;prev_tags.innerHTML=tags_html;edit_form.style.display='none';preview_form.style.display='block';if(rm){var html=process_markdown();preview_markdown(html);submit_markdown(html)}}}
function preview_edit_end(){var preview_form=document.getElementById('v-edit-preview');var edit_form=document.getElementById('v-edit');if(preview_form&&edit_form){preview_form.style.display='none';edit_form.style.display='block'}}
function save_html(){if(rm){var html=process_markdown();submit_markdown(html)}}
function process_markdown(){var body=document.getElementById('insert_body');var html=rm.render(body.value);return html}
function preview_markdown(html){if(!rm){return}
var preview_form=document.getElementById('v-edit-preview');var edit_form=document.getElementById('v-edit');if(edit_form&&preview_form){var body=document.getElementById('prev-body');body.innerHTML=html}}
function submit_markdown(html){if(!rm){return}
var preview_form=document.getElementById('v-edit-preview');var edit_form=document.getElementById('v-edit');var bodymd=document.getElementById('mdhtml');if(edit_form&&preview_form&&bodymd){bodymd.value=html}}
function enable_toc(is_article=!1){$(document).ready(function(){$('#toc').toc({headings:"h1,h2,h3,h4,h5,h6",elementClass:'toc',ulClass:'nav',heading:'Table of Contents'});fix_toc(is_article);top_links()})}
function fix_toc(is_article){$("ul.toc-ul-root li").each(function(){var txt=$(this).text();if(txt=="Admin Menu"||txt=="User Menu"){$(this).remove()}});if(is_article){$("ul.toc-ul-root li:nth-child(2)").remove()}
if($("ul.toc-ul-root li").length<=1){$("#toc.toc").remove()}}
function top_links(){$("h1,h2").not(".v-article-title").after("<div class='a-top-div'><a class='a-top' href='#top'>Top</a></div>")}
function clearSelection(){var sel;if((sel=document.selection)&&sel.empty){sel.empty()}else{if(window.getSelection){window.getSelection().removeAllRanges()}
var activeEl=document.activeElement;if(activeEl){var tagName=activeEl.nodeName.toLowerCase();if(tagName=="textarea"||(tagName=="input"&&activeEl.type=="text")){activeEl.selectionStart=activeEl.selectionEnd}}}}
function show_toast(msg="Text copied to clipboard.",timeout=4000,bgcol="#444444",txtcol="#eeeeee",pos="bottom-right",txtalign="left",){$.toast({text:msg,showHideTransition:'plain',allowToastClose:!0,hideAfter:timeout,stack:4,position:pos,bgColor:bgcol,textColor:txtcol,textAlign:txtalign,loader:!1,loaderBg:'#9EC600',beforeShow:function(){},afterShown:function(){},beforeHide:function(){},afterHidden:function(){}})}
var vMobile=!1;$(document).ready(function(){var isMobile=window.matchMedia("only screen and (max-width: 760px)");if(isMobile.matches){vMobile=!0;$("a[data-fancybox]").click(function(){show_toast(msg="Swipe up or down to close",timeout=1000)})}})